INSERT INTO admiralaru_new.dgb4n_modules(id, asset_id, title, note, content, ordering, `position`, checked_out, checked_out_time, publish_up, publish_down, published, module, access, showtitle, params, client_id, language) VALUES
(102, 941, 'Текст на главной', '', '<h1>Авто с пробегом в СПб</h1>\r\n<h2>Автосалон "Адмирал Моторс" приветствует вас, уважаемые автомобилисты!</h2>\r\n<p>Наша компания специализируется на покупке и продаже авто с пробегом в СПб.</p>\r\n<p>Если Вы ищете где купить ПОДЕРЖАННЫЙ, но НАДЕЖНЫЙ АВТОМОБИЛЬ в Санкт-Петербурге, вы нашли то, что вам нужно!</p>\r\n<h2>Почему стоит купить авто с пробегом в СПб именно у нас?</h2>\r\n<p>&nbsp;Сайты по продаже авто вроде Бибика ру или Авито дадут вам, конечно же, более широкий выбор автомобилей с пробегом, однако обратившись в наш АВТОСАЛОН по продаже подержанных авто вы всегда можете быть уверены, что не получите за свои деньги четырехколесного кота в мешке!</p>\r\n<p>&nbsp;Все бу машины в нашем автосалоне проходят предпродажную проверку!</p>\r\n<p>&nbsp;Мы дорожим своей репутацией и никогда не предложим клиенту плохой автомобиль. Поэтому &nbsp;<a href="/cars.html" title="Все автомобили имеющиеся в наличии в нашем автосалоне"><strong>купить авто</strong></a> с пробегом в СПб&nbsp;у нас не только безопасно, но и выгодно!</p>\r\n<h2>Автокредит</h2>\r\n<p>Если вы решили купить бу авто, но у вас не хватает средств, то мы с радостью поможем вам купить <a href="/crediting.html" title="Авто с пробегом в кредит. Автокредит без первого взноса и без КАСКО"><strong>авто c пробегом в кредит</strong></a>. В том числе мы предлагаем автокредит без первого взноса и автокредит без КАСКО!</p>\r\n<ul>\r\n<li>Вы получите автомобиль сразу после подписания договора в банке!</li>\r\n<li>Требуется минимальный пакет документов!</li>\r\n<li>Вы сможете создать себе хорошую кредитную историю!</li>\r\n</ul>\r\n<h2>Продажа авто в Санкт-Петербурге</h2>\r\n<p>Если же Вы хотите продать свой бу автомобиль - мы с радостью возьмем на себя хлопоты по продаже вашего авто! Наш автосалон предлагает следующие услуги:</p>\r\n<ul>\r\n<li><strong><a href="/sell-in.html" title="Срочный выкуп автомобилей, в том числе кредитных">Срочный выкуп</a></strong></li>\r\n<li><strong><a href="/comission.html" title="Продать авто в СПб через комиссию">Комиссионная продаджа</a></strong></li>\r\n<li><strong><a href="/trade-in.html" title="Обмен авто или трейд ин">Трейд Ин или обмен авто</a></strong></li>\r\n</ul>\r\n<p>Продайте своё авто у нас и вы сэкономите кучу времени и сил! Мы проведем встречи со всеми возможными покупателями и разместим объявления о продаже вашего автомобиля на всех популярных сервисах по продаже авто с пробегом таких как:</p>\r\n<ul>\r\n<li>авто ру</li>\r\n<li>авито ру</li>\r\n<li>дром ру</li>\r\n<li>и т.д.</li>\r\n</ul>\r\n<p>В итоге продажа вашего авто принесет Вам те же деньги, а мы избавим от головной боли от встреч со странными покупателями и нудного размещения объявлений в интернете.</p>', 2, 'position-4', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*');
